    let expensesContent = <p>No Expenses are found</p>;

    if (props.filteredExpenses.length > 0) {
      

    
    return <ul className="expenses-list">
        {
            props.filteredExpenses.map((expense) => (
                <ExpenseItem
                  date={expense.date}
                  title={expense.title}
                  amount={expense.amount}
                  key={expense.id}
                />
        
